        fontSize: 28,
        //marginVertical: 10,
        fontWeight:'bold',
        alignSelf: 'flex-start'
        //color:'#f26530'
        
    },

    right: {
    fontSize:12, 
    fontWeight:'bold',
    alignSelf: 'flex-end',
    color: '#707070'
    

},
    title:
    {fontWeight: 'bold', 
    fontSize:18, 
    alignSelf: 'flex-start',
    marginBottom: 20,
    color:'#f26530'
    },
   

    margin: {
        width: '95%',
        //flexDirection:'row'
        
    },
    textBody: {
        fontWeight: 'bold', fontSize:15, alignSelf: 'flex-start', 
    },
});

